import React from 'react';
import {} from 'react-bootstrap';
import { Link } from 'react-router-dom';
import '../style.css';

import Header from '../components/Header';

import heroimg from '../images/heroimage.jpg';

const Homepage = () => (
	<div>
		<Header />
		<div className="after-heading" style={styles.heroImg}>
			<h1>hello</h1>
		</div>
	</div>
);

const styles = {
	heroImg: {
		backgroundImage:
			'linear-gradient(rgba(109, 109, 109, 0.3), rgba(109, 109, 109, 0.3)), url(/src/images/heroimage.jpg)'
	},
	heroAnna: {}
};

export default Homepage;
